import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../Auth/AuthContext';
import styles from './MasterGroup.module.css';

export default function MasterGroupPages() {
  const [userId, setUserId] = useState(null);
  const { isAuthenticated, userId: authUserId } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    if (isAuthenticated) {
      const getCurrentUser = async () => {
        try {
          const response = await axios.get('http://127.0.0.1:8000/get_current_user', {
            withCredentials: true,
          });

          if (response.data.user_id !== undefined) {
            setUserId(response.data.user_id);
          } else {
            console.error('Ошибка получения ID пользователя: ID пользователя не получен от сервера');
          }
        } catch (error) {
          console.error('Ошибка получения ID пользователя:', error.response ? error.response.data : 'Сервер не ответил');
        }
      };

      getCurrentUser();
    }
  }, [isAuthenticated, authUserId]);

  const goToByMG = () => {
    navigate('/by-master-group');
  };

  const goToByCource = () => {
    navigate('/by-cource');
  };

  const goToHomeWork = () => {
    navigate('/home-work');
  };

  const goToTeachers = () => {
    navigate('/teachers');
  };

  const goToProgress = () => {
    navigate('/progress');
  };

  const goToChat = () => {
    navigate('/chat');
  };

  const goToMyMG = () => {
    navigate('/my-master-group');
  };

  const goToMyCourses = () => {
    navigate('/my-courses');
  };

  const handleGetUserId = async () => {
    if (isAuthenticated) {
      try {
        const response = await axios.get('http://127.0.0.1:8000/get_current_user', {
          withCredentials: true,
        });

        if (response.data.user_id !== undefined) {
          alert(`ID авторизованного пользователя: ${response.data.user_id}`);
        } else {
          console.error('Ошибка получения ID пользователя: ID пользователя не получен от сервера');
        }
      } catch (error) {
        console.error('Ошибка получения ID пользователя:', error.response ? error.response.data : 'Сервер не ответил');
      }
    } else {
      alert('Пользователь не аутентифицирован');
    }
  };


  return (
    <div>
      <form className={styles.LCForm}>
        <h1 className={styles.LCTitle}>Личный кабинет</h1>
        <div className={styles.LCButton}>
          <button onClick={goToByMG} className={styles.ByMGButton}>
            Купить мастер-группу
          </button>
          <button onClick={goToByCource} className={styles.ByCourceButton}>
            Купить курс
          </button>
        </div>
      </form>

      <form className={styles.Menu}>
      <button onClick={handleGetUserId} className={styles.GetUserIdButton}>
            Получить ID пользователя
          </button>
        <div className={styles.MenuButton}>
          <button onClick={goToByMG} className={styles.MenuByMGButton}>
            Мастер-группы
          </button>
          <button onClick={goToByCource} className={styles.MenuByMGButton}>
            Курсы
          </button>
          <button onClick={goToHomeWork} className={styles.MenuByMGButton}>
            Домашние задания
          </button>
          <button onClick={goToTeachers} className={styles.MenuByMGButton}>
            Преподаватели
          </button>
          <button onClick={goToProgress} className={styles.MenuByMGButton}>
            Достижения
          </button>
          <button onClick={goToChat} className={styles.MenuByMGButton}>
            Общий чат
          </button>
          <button onClick={goToMyMG} className={styles.MenuByMGButton}>
            Основной курс
          </button>
          <button onClick={goToMyCourses} className={styles.MenuByMGButton}>
            Курсы
          </button>
          <button onClick={handleGetUserId} className={styles.GetUserIdButton}>
            Получить ID пользователя
          </button>
        </div>
        <h5 className={styles.my_mgStatus}>Вы еще ничего не выбрали</h5>
        <h5 className={styles.my_CourceStatus}>У вас нет курсов</h5>
        <hr className={styles.MenuByMGButton}/>
      </form>
    </div>
  );
}
